import React from 'react';
import styles from './users.module.css';

let Users = (props) => {
    if (props.users.length === 0)
    {  props.setUsers([
        {
            id: 1,
            photoUrl: 'data:image/jpeg;base64,',
            followed: true,
            fullname: 'Roma',
            status: 'i am a boss',
            location: {city: 'Alexandria', country: 'Ukraine'}
        },
        {
            id: 2,
            photoUrl: 'data:image/jpeg;base64,',
            followed: true,
            fullname: 'Vlad',
            status: 'i am a boss too',
            location: {city: 'Dnipro', country: 'Ukraine'}
        },
        {
            id: 3,
            photoUrl: 'data:image/jpeg;base64,',
            followed: false,
            fullname: 'Lev',
            status: 'i am a boss too',
            location: {city: 'Kharkov', country: 'Ukraine'}
        }
    ])}


    return (
        <div>{
            props.users.map(u => <div key={u.id}>
                <span>
                    <div>
                           <img src={u.photoUrl} className={styles.userPhoto}/>
                    </div>
                <div>
                    {u.followed
                        ? <button onClick={() => {
                            props.unfollow(u.id)
                        }}>UnFollow</button>
                        : <button onClick={() => {
                            props.follow(u.id)
                        }}>Follow</button>}
                </div>
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </span>
                </span>
            </div>)
        }
        </div>
    )
}
export default Users;